import React, { Component } from 'react'

import { Button, Modal, ModalHeader, ModalBody, ModalFooter , ButtonGroup} from 'reactstrap';
import Sign from './Member/Sign'
import Register from './Member/Register'


export default class AppNav extends Component {

  constructor(props) {
    super(props);
    this.state = {
      modal: false
    };

    this.toggle = this.toggle.bind(this);
  }

  toggle() {
    this.setState(prevState => ({
      modal: !prevState.modal
    }));
  }

  render() {
    return (

      <div>

      <Button style={{marginRight:'50px'}} color="danger" onClick={this.toggle}>{this.props.buttonLabel} Sign</Button>

      <Modal  isOpen={this.state.modal} toggle={this.toggle} 
      className={this.props.className}>
        <ModalHeader style={{
  width: '675px',
  height: 'auto',
  backgroundColor: '#ffffff'

         }} toggle={this.toggle}></ModalHeader>
        <ModalBody style={{
  width: '675px',
  height: 'auto',
  backgroundColor: '#ffffff'

         }} >
          <Sign />
        </ModalBody>
        <ModalFooter style={{
  width: '675px',
  height: 'auto',
  backgroundColor: '#ffffff', textAlign:'center'

         }} >
         <h4 style={{
  backgroundColor: '#ffffff', color: '#838383'
         }} >Already have an account ?</h4> <h4 style={{
          backgroundColor: '#ffffff', color: '#2e4ffc'
                 }}>Login</h4>
        </ModalFooter>
      </Modal>




      <Button color="danger" onClick={this.toggle}>{this.props.buttonLabel} Register</Button>

      <Modal  isOpen={this.state.modal} toggle={this.toggle} 
      className={this.props.className}>
        <ModalHeader style={{
  width: '675px',
  height: 'auto',
  backgroundColor: '#ffffff'

         }} toggle={this.toggle}></ModalHeader>
        <ModalBody style={{
  width: '675px',
  height: 'auto',
  backgroundColor: '#ffffff'

         }} >
          <Register />
        </ModalBody>
        <ModalFooter style={{
  width: '675px',
  height: 'auto',
  backgroundColor: '#ffffff', textAlign:'center'

         }} >
         <h4 style={{
  backgroundColor: '#ffffff', color: '#838383'
         }} >Already have an account ?</h4> <h4 style={{
          backgroundColor: '#ffffff', color: '#2e4ffc'
                 }}>Login</h4>
        </ModalFooter>
      </Modal>
    </div>
    )
  }
}
